import React from 'react'
import TodoList from '../components/TodoList'
import TodoContainer from './TodoContainer'

import { connect } from 'react-redux'

const mapStateToProps = state => {
  return {
    todoTasks: state.todos.todoTasks,
  }
}

const TodoListContainer = props => {
  console.log(props, 'PROPS')

  const { taskId, title } = props.todoTasks
  const todos = props.todoTasks.map(task => {
    console.log(task, 'task')
    return <TodoContainer id={taskId} key={taskId} content={title} />
  })

  const extraProps = { todos }

  if (todos.length) {
    return <TodoList {...extraProps} />
  }
  return null
}

export default connect(mapStateToProps)(TodoListContainer)
